let elements = [[smileys,['smileys','Smileys & People',false]],[nature,['nature','Animals & Nature',false]],[food,['food','Food & Drink',false]],[activities,['activities','Activity',false]],[places,['places','Travel & Places',false]],[objects,['objects','Objects',false]],[symbols,['symbols','Symbols',false]],[flags,['flags','Flags',false]]];
let elementsMap = new Map(elements);
let tones = ["🏻","🏼","🏽","🏾","🏿"];
var head = document.getElementById("head");
var smileys_div = document.getElementById("smileys-div");
var food_div = document.getElementById("food-div");
var nature_div = document.getElementById("nature-div");
var places_div = document.getElementById("places-div");
var activities_div = document.getElementById("activities-div");
var objects_div = document.getElementById("objects-div");
var symbols_div = document.getElementById("symbols-div");
var flags_div = document.getElementById("flags-div");
var tone = document.getElementsByClassName("tone");
let textArea = document.getElementById("textArea");
function echoCache(result) {
    parseInt(result)<7 ? cache = result : cache = "5";
}
function retrieveCache() {
    chrome.storage.local.get('tone', function(result) {
        echoCache(result.tone);
    });
}
var cache = retrieveCache();
var check = false;
var lastCategory;
function filter(keepTone, category) {
    if (category != smileys && category != activities) {
        return 0;
    }
    for (var i = 0; i < tones.length; i++) {
        var allTones = document.getElementsByClassName(tones[i]);
        var j = 0;
        while (j < allTones.length) {
            if (keepTone == i || keepTone == 5) allTones[j].style.display = "";
            else allTones[j].style.display = "none";
            j++;
        }
    }
}
function fillPage(category = smileys) {
    var index = 0;
    head.innerHTML = elementsMap.get(category)[1]+"<button id='settings'>⚙️</button>";
    document.getElementById("settings").addEventListener("click", function() {
        document.getElementById("settingspage").style.display == "none" ? document.getElementById("settingspage").style.display = "block" : document.getElementById("settingspage").style.display = "none";
    });
    if (!elementsMap.get(category)[2]){
        while (index < category.length) {
            var button = document.createElement("button");
            if (category[index].includes(tones[0])) button.setAttribute("class", elementsMap.get(category)[0]+"-button "+tones[0]);
            else if (category[index].includes(tones[1])) button.setAttribute("class", elementsMap.get(category)[0]+"-button "+tones[1]);
            else if (category[index].includes(tones[2])) button.setAttribute("class", elementsMap.get(category)[0]+"-button "+tones[2]);
            else if (category[index].includes(tones[3])) button.setAttribute("class", elementsMap.get(category)[0]+"-button "+tones[3]);
            else if (category[index].includes(tones[4])) button.setAttribute("class", elementsMap.get(category)[0]+"-button "+tones[4]);
            else button.setAttribute("class", elementsMap.get(category)[0]+"-button");
            button.innerText = category[index];
            document.getElementById(elementsMap.get(category)[0]+"-div").appendChild(button);
            button.addEventListener("click", function() {
                textArea.value += this.innerText;
                textArea.select();
                document.execCommand("copy");
            });
            index++;
        }
        elementsMap.get(category)[2] = true;
    }
    lastCategory = category;
    filter(cache, category);
}
function getKey(val) {
    for (let [k,v] of elementsMap.entries()) if (v[0] == val) return k;
}
function switchPage() {
    inCategory = getKey(this.id);
    inCategory == smileys ? smileys_div.style.display = "": smileys_div.style.display = "none";
    inCategory == food ? food_div.style.display = "" : food_div.style.display = "none";
    inCategory == nature ? nature_div.style.display = "" : nature_div.style.display = "none";
    inCategory == places ? places_div.style.display = "" : places_div.style.display = "none";
    inCategory == activities ? activities_div.style.display = "" : activities_div.style.display = "none";
    inCategory == objects ? objects_div.style.display = "" : objects_div.style.display = "none";
    inCategory == symbols ? symbols_div.style.display = "" : symbols_div.style.display = "none";
    inCategory == flags ? flags_div.style.display = "" : flags_div.style.display = "none";
    fillPage(inCategory);
}
for (let [k,v] of elementsMap) document.getElementById(v[0]).addEventListener("click", switchPage);
function insertCache() {
    var set = this.id;
    chrome.storage.local.set({'tone': set });
    cache = set;
    filter(cache, lastCategory);
}
for (var i = 0; i < tone.length; i++) document.getElementById(i.toString()).addEventListener("click", insertCache);
setTimeout(function(){fillPage();}, 0); //waiting for cache
